document.addEventListener('DOMContentLoaded',function(n){const o=document.querySelectorAll('.sun');o.forEach(function(n){const o=n.querySelectorAll('a');o.forEach(function(n){const t=n.attributes.href.nodeValue;if('#'!==t&&!n.classList.contains('sun-isolate')){const e=Array.prototype.filter,s=e.call(o,function(o){return o!==n&&o.attributes.href.nodeValue===t&&!o.classList.contains('sun-isolate')});n.onmouseover=function(n){s.forEach(function(n){n.classList.add('sun-hover')})},n.onmouseout=function(){s.forEach(function(n){n.classList.remove('sun-hover')})}}})})})
